export const SHIPS_FETCHING = 'SHIPS_FETCHING';
export const SHIPS_SUCCESS = 'SHIPS_SUCCESS';
export const SHIPS_ERROR = 'SHIPS_ERROR';

export const fetchShips = () => dispatch => {
    dispatch({
        type: SHIPS_FETCHING,
        payload: 'stuff goes here'
    })
}
